import React from 'react'
import "./Page16.css"
import { Button } from 'antd';

import { Layout, Menu } from 'antd';
import { PieChartOutlined, FileTextOutlined, ExceptionOutlined, PhoneOutlined } from '@ant-design/icons';
import { Row, Col, Divider } from 'antd';

const { Header, Sider, Content } = Layout;

function Page16() {
    return (
        <Layout>
                <Sider className="sidebar">
                    <Menu theme="light" mode="inline" defaultSelectedKeys={['4']}>
                        <Menu.Item key="1" icon={<PieChartOutlined />}>
                            แดชบอร์ด
                        </Menu.Item>
                        <Menu.Item key="2" icon={<FileTextOutlined />}>
                            การประเมินผลสัมฤทธิ์
                        </Menu.Item>
                        <Menu.Item key="3" icon={<ExceptionOutlined />}>
                            คู่มือการประเมิน
                        </Menu.Item>
                        <Menu.Item key="4" icon={<PhoneOutlined />}>
                            02 186 7111
                        </Menu.Item>
                    </Menu>
                </Sider>
                <Layout>
                    <Header className="site-layout-sub-header-background" style={{ padding: 0 }} />
                    <Content style={{ margin: '24px 16px 0' }}>
                        <div className="site-layout-background" style={{ padding: 24, minHeight: 360 }}>
                            {/* <Divider orientation="left">Horizontal</Divider> */}
                            <Row gutter={[8, 8]}>
                                <Col className="gutter-row" span={6} >
                                    <div className="box4">
                                        <div>ผลสัมฤทธิ์</div>
                                        <div>เปอร์เซ็น</div>
                                    </div>
                                </Col>
                                <Col className="gutter-row" span={6}>
                                    <div className="box4">
                                        <div>สัดส่วนร้อยละ</div>
                                        <div>เปอร์เซ็น</div>
                                    </div>
                                </Col>
                                <Col className="gutter-row" span={6}>
                                    <div className="box4">
                                        <div>สัดส่วนร้อยละ</div>
                                        <div>เปอร์เซ็น</div>
                                    </div>
                                </Col>
                                <Col className="gutter-row" span={6}>
                                    <div className="box4">
                                        <div>สัดส่วนร้อยละ</div>
                                        <div>เปอร์เซ็น</div>
                                    </div>
                                </Col>
                            </Row>
                            <Row gutter={[8, 16]}>
                                <Col className="gutter-row" span={6}>
                                    <div className="box4">
                                        <div>เบอร์โทรติดต่อ : </div>
                                        <div>อีเมล์ : </div>
                                        <div>สถานที่ติดต่อ : </div>
                                        <div>ชื่อผู้ประสานงาน : </div>
                                    </div>
                                </Col>
                                <Col className="gutter-col" span={18}>
                                    <div className="h3">
                                        <div>สัดส่วนร้อยละ</div>
                                        <div>เปอร์เซ็น</div>
                                    </div>
                                </Col>
                            </Row>
                            <Row gutter={[8, 16]}>
                                <Col className="gutter-row" span={6}>
                                    <div className="box4">
                                        <center>

                                            <div>อยู่ระหว่างเก็บหลักฐาน</div>
                                            <Divider />
                                            <div>สถานะปัจจุบัน</div>
                                        </center>
                                    </div>
                                </Col>
                            </Row>
                        </div>
                    </Content>
                </Layout>
            </Layout>
        // <div className="Background">


        //     <div className="h1">



        //         <div className="box1">

        //             {/* <Button ><div className="box2">

        //             </div> </Button>

        //             <Button ><div className="box3">
        //                 Primary
        //             </div> </Button>

        //             <Button ><div className="box4">
        //                 Primary
        //             </div> </Button>
        //             <Button ><div className="box4">
        //                 Primary
        //             </div> </Button> */}
        //         </div>

        //     </div>
        //     <div className="h2">
        //         <div className="h3">

        //         </div>
        //         <div className="h3">

        //         </div>
        //         <div className="h3">

        //         </div>
        //         <div className="h3">

        //         </div>
        //     </div>
        // </div>



    )
}

export default Page16
